      <div className="px-10 pt-10 bg-gray-600 text-center">
    <Typography variant="h1">Products</Typography>
      <div className="flex flex-wrap mx-auto w-100 justify-between gap-y-8">
      {mappedaray}
      </div>
      </div>
  )
}
